import React, { useEffect, useState } from 'react'

export default function Cart({cart}) {
    const [newCart, setNewCart] = useState([])

    useEffect(() => {
        setNewCart(cart)
    }, [])
  return (
    <div className="cart">
        <h1>VOICI</h1>
        {cart.map((item, index) => {
            return <div className='cart-item' key={index}>

                <p>{item.name}</p>
            </div>
        })}
    </div>
  )
}
